import Link from "next/link";
const Navbar = ()=> (
    <nav className="navbar">
    <head>
    <script src="https://kit.fontawesome.com/0ad3c3f5c3.js" crossorigin="anonymous"></script>
    </head>
    <ul className="navbar-nav">
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        <span className="link-text">News</span>
        </a>
      </li>
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        <span className="link-text">News</span>
        </a>
      </li>
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i className="far fa-newspaper">dd</i>
        <span className="link-text">News</span>
        </a>
      </li>
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        <span className="link-text">News</span>
        </a>
      </li>
      <li className="nav-item">
        <a href="#" className="nav-link">
        <i class="far fa-newspaper"></i>
        <span className="link-text">News</span>
        </a>
      </li>
    </ul>
    <style jsx>
      {`
      .navbar{
        width: 5rem;
        height: 100vh;
        position:fixed;
        background-color: #2A2E35;
      }
      .navbar-nav{
        list-style: none;
        padding: 0;
        margin: 0;
        display: flex;
        flex-direction: column;
        align-itmes: center;
        height: 100%;
      }
      .nav-item{
        width: 100%;
      }
      .nav-item:last-child{
        margin-tom:auto;
      }
      .nav-link{
        display: flex;
        align-items: center;
        height: 5rem;
        color: white;
        text-decoration: none;
      }
      .link-text{
        display:none;
        margin-left:1rem;
      }
      .nav-link svg{
        min-width:2rem;
        margin: 0 1.5rem;
      }
      `}
    </style>
  </nav>
);

export default Navbar;
